import React, { Component } from "react";

class App extends Component {
  state = {
    helloString: ""
  };

  componentDidMount() {
    fetch("http://localhost:8080/helloWorld")
      .then(res => res.json())
      .then(data => {
        console.log(data);
        this.setState({ helloString: data });
      })
      .catch(console.log);
  }

  render() {
    return <div>{this.state.helloString}</div>;
  }
}

export default App;
